import React, { Component } from 'react'
import { Parallax, ParallaxLayer } from 'react-spring/renderprops-addons'
import FF_1 from "../images/FF_1.png"


export class Comp_3 extends Component {
    render() {

        const url = FF_1

        return (

            <Parallax pages={3} scrolling={true} horizontal ref={ref => (this.parallax = ref)}>

                <ParallaxLayer offset={0} speed={0} factor={3} style={{ backgroundImage: url, backgroundSize: 'cover' }} />


                <ParallaxLayer offset={1} speed={1} style={{ backgroundColor: 'navy' }} >
                    HI
                    </ParallaxLayer>
                <ParallaxLayer offset={2} speed={2} style={{ backgroundColor: 'red' }} >
                    HI AGAIN
                    </ParallaxLayer>

            </Parallax>


        )
    }
}

export default Comp_3

const divStyle = {
    backgroundColor: 'navy',
    color: 'blue',
    textAlign: 'center'
}
